import React, { useState, useEffect } from 'react';
import { motion, useAnimation } from 'framer-motion';
import { Image, useColorMode } from '@chakra-ui/react';

interface LoadingCurtaingProps {
    cargado: boolean;
}

export const LoadingCurtaing: React.FC<LoadingCurtaingProps> = ({ cargado }) => {
    const { colorMode } = useColorMode();
    const [darkMode, setDarkMode] = useState(colorMode === 'dark' ? true : false);
    const [FinCarga, setFinCarga] = useState(false);
    const [progress, setProgress] = useState(0);
    const controlsContainer = useAnimation();
    const progressTime = cargado ? 2.5 : 0.5;
    const [centerEmoji, setCenterEmoji] = useState(``);
    const controlsMainContainer = useAnimation();
    const controls = useAnimation();
    const controlsBox = useAnimation();
    const controlsLogo = useAnimation();

    const progressBarContainerStyle: React.CSSProperties = {
        width: '75%',
        backgroundColor: darkMode ? '#ED330C' : '#e0e0e0',
        height: '20px',
        overflow: 'visible',
        borderRadius: '10px',
        border: `5px solid ${darkMode ? '#ED330C' : '#fff'}`,
        borderColor: darkMode ? '#1565C0' : '#fff'
    };

    const progressBarStyle: React.CSSProperties = {
        height: '100%',
        backgroundColor: darkMode ? '#FEFEFEFE' : '#ED330C',
        overflow: 'visible',
        borderRadius: '10px'
    };

    // const imageBoxStyle: React.CSSProperties = {
    //     position: 'relative',
    //     marginTop: '-105px',
    //     marginLeft: '-55px',
    //     height: '75px',
    //     width: '94px',
    //     borderRadius: '10%'
    // };

    const logoStyle: React.CSSProperties = {
        width: '75%',
        height: '20px',
        position: 'absolute',
        top: '50%',
        borderRadius: '10px',
        opacity: '0'
    };

    const mainCaontainerStyle: React.CSSProperties = {
        position: 'fixed',
        top: '0',
        left: '0',
        width: '100%',
        height: '100%',
        backgroundColor: darkMode ? '#111111' : '#1565C0',
        pointerEvents: 'none',
        zIndex: '9999',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        opacity: 1
    };

    const emojis = [
        `<g id="logo">
            <defs>
                <image
                    width="256"
                    height="256"
                    id="img1"
                    href="data:image/png;base64,"
            </defs>
            <use href="#img1" transform="matrix(.773,0,0,.773,161,121)" />
        
        </g>`,
        
        `<g id="control">
            <defs>
                <image
                    width="700"
                    height="700"
                    id="img1"
                    href="data:image/png;base64,"
                />
            </defs>
            <use href="#img1" transform="matrix(0.928, 0, 0, 0.928, -70,-50)" />
            </g>`,
        `<g id="money">
            <defs>
                <image
                    width="256"
                    height="256"
                    id="img1"
                    href="data:image/png;base64,"
                />
            </defs>
            <use href="#img1" transform="matrix(.773,0,0,.773,161,121)" />
             />
            </g>`
    ];
    const getRandomEmojis = () => {
        const randomIndex = Math.floor(Math.random() * (emojis.length - 1)) + 1;
        return emojis[randomIndex]; // Otros elementos con 16.33% de probabilidad cada uno
    };
    useEffect(() => {
        const mediaQuery = window.matchMedia('(prefers-color-scheme: dark)');
        const handleColorSchemeChange = (e: MediaQueryListEvent) => setDarkMode(e.matches);
        mediaQuery.addEventListener('change', handleColorSchemeChange);
        return () => mediaQuery.removeEventListener('change', handleColorSchemeChange);
    }, []);

    useEffect(() => {
        controls.start({ width: `${progress}%`, transition: { duration: progressTime } });
    }, [progress, controls]);

    useEffect(() => {
        const interval = setInterval(() => {
            if (!cargado) {
                setProgress((prevProgress) => {
                    let newProgress = prevProgress + (Math.floor(Math.random() * 10) % 80);
                    if (newProgress > 80) {
                        newProgress = 0;
                    }
                    startBoxAnimation(newProgress);
                    return newProgress;
                });
            } else {
                clearInterval(interval);
                destruirComponente();
            }
        }, 1000);

        return () => clearInterval(interval);
    }, [cargado]);

    const startBoxAnimation = (currentProgress: number) => {
        const backgroundGradient1 = `linear-gradient(-40deg, ${
            darkMode ? '#FEFEFEFE' : '#ED330C'
        } ${currentProgress}%, transparent ${currentProgress}%)`;
        const backgroundGradient2 = `linear-gradient(40deg, ${
            darkMode ? '#FEFEFEFE' : '#ED330C'
        } ${currentProgress}%, transparent ${currentProgress}%)`;
        const backgroundGradient3 = `linear-gradient(0deg, ${
            darkMode ? '#FEFEFEFE' : '#ED330C'
        } ${currentProgress}%, transparent ${currentProgress}%)`;
        controlsBox.start({
            left: `${currentProgress}%`,
            background: [backgroundGradient1, backgroundGradient2, backgroundGradient3],
            rotate: [0, -30, 0],
            transition: { duration: progressTime }
        });
    };

    useEffect(() => {
        if (centerEmoji === ``) {
            const emoji = getRandomEmojis();
            setCenterEmoji(emoji);
        }
    }, []);

    const destruirComponente = async () => {
        startBoxAnimation(100);
        setProgress(100);

        const idTimeout = setTimeout(async () => {
            if (!FinCarga) {
                await controlsContainer.start({ opacity: 0, transition: { duration: 0.5 } });

                // Mostrar el logo (ajusta la dirección de fade según sea necesario)
                await controlsLogo.start({ opacity: 1, transition: { duration: 0.5, ease: 'easeInOut' } });

                await controlsMainContainer.start({ opacity: 0, transition: { duration: 0.5, ease: 'easeInOut' } });
                setFinCarga(true);
            }
        }, 2500);
        return () => clearTimeout(idTimeout);
    };
    if (FinCarga) return null;

    return (
        <motion.div style={mainCaontainerStyle} animate={controlsMainContainer}>
            <motion.div style={progressBarContainerStyle} animate={controlsContainer}>
                <motion.div style={{ ...progressBarStyle, width: '0%' }} animate={controls} />
                {/* <motion.div style={{ ...imageBoxStyle }} animate={controlsBox}>
                    <div
                        style={{
                            position: 'absolute',
                            height: '110px',
                            width: '110px',
                            marginTop: '-9px',
                            marginLeft: '-7px'
                        }}
                    >
                        <svg
                            version="1.1"
                            id="Layer_1"
                            xmlns="http://www.w3.org/2000/svg"
                            xmlnsXlink="http://www.w3.org/1999/xlink"
                            x="0px"
                            y="0px"
                            viewBox="0 0 520 520"
                            xmlSpace="preserve"
                        >
                            <g>
                                <g id="Fondo">
                                    <path
                                        className="st0"
                                        d="M320,389l-56.2,78c-4.5,6.2-13.8,5.8-17.7-0.7L200,389H320z"
                                        fill={darkMode ? '#FEFEFEFE' : '#ED330C'}
                                    />
                                </g>
                                <g id="Outline">
                                    <path
                                        className="st1"
                                        d="M460.1,393.8H316.5l-52.9,73.5c-4.2,5.8-13,5.5-16.7-0.7l-43.5-72.8H59.9c-11.6,0-21-9.4-21-21V69.5
                                    c0-11.6,9.4-21,21-21H460c11.6,0,21,9.4,21,21v303.3C481.1,384.4,471.7,393.8,460.1,393.8z"
                                        fill="none"
                                        stroke={darkMode ? '#1565C0' : '#FFF'}
                                        strokeWidth="8"
                                        strokeLinecap="round"
                                        strokeLinejoin="round"
                                        strokeMiterlimit="10"
                                    />
                                </g>
                                <g id="logo" dangerouslySetInnerHTML={{ __html: centerEmoji }} />
                            </g>
                        </svg>
                    </div>
                </motion.div> */}
            </motion.div>
            <motion.div style={{ ...logoStyle }} animate={controlsLogo}>
                <picture>
                    <Image src="/images/logo.svg"  alt="Logo" margin={'auto'} height={'140'} backgroundColor={'transparent'} />
                </picture>
            </motion.div>
        </motion.div>
    );
};
